// src/components/PlayerList.js
import React from 'react';

function PlayerList({ players }) {
  return (
    <table>
      <thead>
        <tr>
          <th>Nombre</th>
          <th>ELO</th>
          <th>Equipo</th>
          {/* A침ade m치s columnas si es necesario */}
        </tr>
      </thead>
      <tbody>
        {players.map(player => (
          <tr key={player.id}>
            <td>{player.name}</td>
            <td>{player.elo}</td>
            <td>{player.team}</td>
            {/* A침ade m치s datos si es necesario */}
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default PlayerList;
